import React from 'react';
import '../assets/css/ToDos.css'

const List = (props) => {

  const toDos = props.toDos.map(toDo => <span>toDo.task</span>)

  return (
    <div className="list">
      <div className="todo-card">
        <input type="checkbox" />
        <span>{toDos}</span>
        <button>Delete</button>
      </div>
      {typeof toDos}
    </div>
  );
}

export default List;
